 lorsque la pression artérielle est à plusieurs reprises supérieure à 140 millimètres de mercure ou mmHg (systole) pour la pression maximale ou supérieure à 90mmHg (diastole) pour la pression minimale (14-9). Cette maladie silencieuse, qui ne se voit pas, ne se ressent pas, est une des principales causes d\'attaque cérébrale, d\'infarctus, d\'insuffisance cardiaque ou encore d\'insuffisance rénale ! \r\n \r\nDans la loi de Santé Publique de 2004, le Ministère de la Santé s\'est fixé comme objectif une baisse de 2 à 3 mmHg de la pression artérielle systolique moyenne des Français d\'ici à 2008. Pas moins de 20 000 décès pourraient être évités ainsi que de nombreux infarctus du myocarde et d\'accidents vasculaires cérébraux. \r\n \r\n<a href=\"https://stophypertensionarterielle.fr/symptome-hypertension/les-erreurs-a-eviter-lorsque-lon-arrete-de-fumer/\" / rel=\"nofollow\">stress et tension art&#233;rielle</a> \r\n \r\ndiastole systole tension https://stophypertensionarterielle.fr/',0,'0','Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Safari/537.36 OPR/54.0.2952.64','',0,0),(243,12889,'Georgianna Kosuta','trumbore@gmail.com','https://php665.com/바카라카지노','203.245.8.32','2018-09-29 13:06:17','2018-09-29 13:06:17','With thanks! Valuable information!',0,'0','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/62.0.3202.94 Safari/537.36','',0,0),(244,12893,'สล็อต','hildredbratcher@gmail.com','http://www.alummax.com.br/index.php?option=com_k2&amp;view=itemlist&amp;task=user&amp;id=92356','62.89.167.230','2018-09-29 22:08:36','2018-09-29 22:08:36','It\'s very effortless to find out any topic \r\non net as compared to textbooks, as I found this paragraph \r\nat this web site.',0,'0','Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/63.0.3239.26 Safari/537.36 Core/1.63.5383.400 QQBrowser/10.0.1313.400','',0,0),(245,12889,'eezacoxah','iamayxbi@gmail.com','htt