12-22 13:56:45','',0,'http://64.207.144.221/~lemontree/wp-content/uploads/2017/12/cropped-logo1.png',0,'attachment','image/png',0),(12833,1,'2017-12-23 16:16:33','2017-12-23 16:16:33','In order to enhance and to get a continuous patronage of Quality Assurance (QA) culture at different entities/departments of Dhaka International University (DIU), the Institutional Quality Assurance Cell (IQAC) was constituted on 01 July 2015. The IQAC consists of seven (07) entities namely Law, CSE (Computer Science &amp; Engineering), English, EETE (Electrical, Electronics, &amp; Telecommunication Engineering), Business Administration, Pharmacy and Sociology. It is obvious that IQAC is a mutual endeavour between Dhaka International University and University Grants Commission (UGC), Bangladesh which is resolutely committed to ensure the practice of continuously improving quality culture, demonstrate responsibility and enhancement and thus, to satisfy the different stakeholders (Existing Students, Alumni, Academic and Non-Academic Staffs, Employer, etc.). The quality assurance areas covered by IQAC are based on governance, curriculum content design and review, student admission, progress and achievements, physical facilities, teaching-learning and assessment, student support services, staff and facilities, research and extension, as well as process management and continuous improvement. Having set up IQAC, a lot of workshops, training on different events and meetings are being conducted for improving the existing quality culture at different entities of this university. It is mentionable that IQAC itself conducted four (04) QAC (Quality Assurance Committee) meetings, 15 meetings which are related to IQAC fund, as well as 22 academic and non-academic training/workshops based upon Block Allocation till Nov. 2017. Moreover, to maintain an upgrading quality culture on teaching-learning methods and curriculum design, SA (Self-Assessment) Committees of different entities also conducted a lot of meetings with their faculty members. The External Peer Reviews (EPRs) of Law, CSE and English departments were successfully accomplished on 31 May-02 June 2017. Likewise, the EPRs of departments of Business Administration, Pharmacy, Sociology as well as EETE were fruitfully completed on 16-18 May, 25-27 May as well as on 13-15 July, 2017 respectively. Accordingly, all Reports of seven departments have already been submitted at QA (Quality Assurance) Unit, UGC after furnishing necessary improvement plans.','Home','','publish','closed','closed','','home','','','2018-05-11 13:00:56','2018-05-11 13:00:56','',0,'http://64.207.144.221/~lemontree/?page_id=12833',0,'page','',0),(12834,1,'2017-12-23 16:16:33','2017-12-23 16:16:33','','Home','','inherit','closed','closed','','12833-revision-v1','','','2017-12-23 16:16:33','2017-12-23 16:16:33','',12833,'http://64.207.144.221/~lemontree/index.php/2017/12/23/12833-revision-v1/',0,'revision','',0),(12839,1,'2017-12-25 06:13:18','2017-12-25 06:13:18','','footer-logo','','inherit','open','closed','','footer-logo','','','2017-12-25 06:13:18','2017-12-25 06:13:18','',0,'http://64.207.144.221/~lemontree/wp-content/uploads/2017/12/footer-logo.png',0,'attachment','image/png',0),(12840,1,'2017-12-25 06:13:19','2017-12-25 06:13:19','','color-logo','','inherit','open','closed','','color-logo','','','2017-12-25 06:13:19','2017-12-25 06:13:19','',0,'http://64.207.144.221/~lemontree/wp-content/uploads/2017/12/color-logo.png',0,'attachment','image/png',0),(12842,1,'2017-12-25 16:27:29','2017-12-25 16:27:29',' ','','','publish','closed','closed','','12842','','','2018-05-10 09:56:41','2018-05-10 09:56:41','',0,'http://64.207.144.221/~lemontree/?p=12842',1,'nav_menu_item','',0),(12863,1,'2017-12-26 14:10:08','2017-12-26 14:10:08','','case-study1','','inherit','open','closed','','case-study1','','','2017-12-26 14:10:08','2017-12-26 14:10:08','',0,'http://64.207.144.221/~lemontree/wp-content/uploads/2017/12/case-study1.jpg',0,'attachment','image/jpeg',0),(12864,1,'2017-12-26 14:10:11','2017-12-26 14:10:11','','case-study2','','inherit','open','closed','','case-study2','','','2017-12-26 14:10:11','2017-12-26 14:10:11','',0,'http://64.207.144.221/~lemontree/wp-content/uploads/2017/12/case-study2.jpg',0,'attachment','image/jpeg',0),(12865,1,'2017-12-26 14:10:14','2017-12-26 14:10:14','','case-study3','','inherit','open','closed','','case-study3','','','2017-12-26 14:10:14','2017-12-26 14:10:14','',0,'http://64.207.144.221/~lemontree/wp-content/uploads/2017/12/case-study3.jpg',0,'attachment','image/jpeg',0),(12880,1,'2017-12-26 16:45:09','2017-12-26 16:45:09','<div><span class=\"pinContainer\"><img class=\"pinable\" src=\"https://blog.hubspot.com/hubfs/podcast-2018.jpg\" data-external=\"yes\" data-image-enhancer=\"larger than third of 645\" /></span></div>\r\n<div id=\"lhgjm/H+RcSKdVOpXbkTYvGyhceBnVw9hxxc/+M3vj4=_1607dec3dd2:42c46e:7157a206_entryContent\" class=\"content\">\r\n\r\nI’ve become a morning walking companion to people I may never meet.\r\n\r\nHow is this possible? They take me along in their earbuds as they stream my podcast, <em><a href=\"https://agencymanagementinstitute.com/agency-owner-podcast/\" target=\"_blank\" rel=\"noopener\">Build a Better Agency</a></em>\r\n\r\nIt’s a wonderful sign of things to come for marketers willing to venture into the podcasting universe.\r\n\r\nOnce a fringe platform, podcasts are now surprisingly mainstream. According to Nielsen, <a href=\"https://www.podcastinsights.com/podcast-statistics/\" target=\"_blank\" rel=\"noopener\">six out of 10 people</a> understand what they are, and 112 million Americans -- 40 percent of the nation’s population -- have listened to at least one. Though podcast listeners lean male, it isn’t by much: 56 percent are men, while 44 percent are women.\r\n\r\nMarketing professionals must not only be aware of these statistics, but they must also leverage them in their own campaigns. When 67 million men and women are monthly podcast consumers, it’s a niche that deserves serious contemplation. Add to that fact the amazing statistic that <a href=\"https://www.fastcompany.com/3035954/the-surprisingly-profitable-rise-of-podcast-networks\" target=\"_blank\" rel=\"noopener\">63 percent</a> of podcast listeners made a purchase based on something the host recommended, and you have yourself a veritable gold mine.\r\n\r\nOf course, you have to crawl, then walk, then break into a steady trot to glean the benefits.\r\n<h2><strong>A no-nonsense primer from a podcast experimenter.</strong></h2>\r\nIn my case, I’d written blog posts, conducted webinars, and published articles in places like <em>Forbes</em> and <em>Fast Company</em> for some time. These content producers worked, but I felt a different portal would help connect with more agencies and leaders in an accessible, easy to find, on-demand format.\r\n\r\nAs a longtime podcast listener myself, I recognized that the podcasting platform was the next logical step for me -- especially if I wanted to reach a narrow audience of mid-sized agency owners and leaders as an authority in my field for more than 23 years. And as a long-time professional, I hired Predictive ROI, an Agency Management Institute agency, to produce the podcast so I wouldn’t make as many rookie technical mistakes.\r\n\r\nStill, opening yourself up to podcasting is a little like breaking the lid on Pandora’s box. Until you do it, you have no idea what to expect. Still, that doesn’t mean you can’t head off issues before you go live.\r\n\r\nExpect a certain amount of learning as you go, but be ready to explore the technology before fully launching your podcast. You wouldn’t open a bakery with your very first pie, so don’t hit “publish” until you get the lay of the land and make a plan. (Being a podcast guest prior to launching your own is a smart idea, too.)\r\n<h2><strong>Podcasting in the beginner’s circle.</strong></h2>\r\nEven if you’ve never been in front of a mic before, you can map out the first phase of a solid podcast schedule. From there, you’ll be able to branch out.\r\n<h3><strong>1. Create a checklist to keep yourself on task.</strong></h3>\r\nI asked myself tons of questions repeatedly before committing to podcasting. They included everything from the niche audience I wanted to reach to whether being the host of a podcast was a short-term fad or a long-term interest. I also considered what podcast style I preferred to offer the public, including a show prep and publishing schedule.\r\n\r\nObviously, your checklist will be individualized, but be sure it includes a section on technical elements. Setting up audio, iTunes, accounts, and interviews can be tricky if you haven’t done your homework.\r\n<h3><strong>2. Set up your basic show format.</strong></h3>\r\nEvery interviewer prefers to run his or her podcast in a particular way. Many podcasters ask guests the same questions, but as a listener, I find that gets stale in a hurry. Sure, it’s less prep work, but it makes the host look lazy. I preferred interviewing subject matter experts but wanted to occasionally keep the door open to produce a solocast. My compromise was a 4–1 ratio of interviews to solocasts.\r\n\r\nI was reasonably confident that I could have a few questions on hand and then launch into a conversation on the fly from there. A big risk? Maybe. But I believed I could pull off a 45-minute to 60-minute conversation without a safety net.\r\n<h3><strong>3. Leverage the heck out of your network.</strong></h3>\r\nThe first 10 episodes set the tone for any podcast launch, so make sure you line up high-profile, interesting, engaging guests who won’t be turned off if you have very few -- or no -- listeners. My friends came through in a big way for me, offering me rock stars from day one. Not only did they help publicize the podcast, but they also generously allowed me to ride on their social media coattails.\r\n<h3><strong>4. Track your downloads.</strong></h3>\r\nRob Walch was one of my recent podcast guests who offered an important consideration for any podcasters: You have to stay on top of your downloads. Rob’s suggestion is to hit at least 500 downloads an episode to feel sure you’ve broken the cycle of only having people in your inner circle tune in.\r\n\r\nWhat’s a reasonable download number for your, quote, “success”? Only you can determine this, but it helps to keep a steady eye on the numbers. Starting to see a downward trend in listenership? Go back to square one and ask those tough questions again so you can pivot before your podcast loses traction.\r\n<h3><strong>5. Produce great content consistently.</strong></h3>\r\nDoes everyone have a bad episode once in a while? Sure. And if you’ve planned in advance and have great content in the bag, you can simply not release it in lieu of a better one. Before you release your podcasts publicly, try to have several on hand. That way, you get the relief of a buffer zone.\r\n\r\nDon’t try to start too quickly. You can always ramp up your delivery later. With my travel schedule that sees me on no fewer than 200 planes a year, I decided to get 10 episodes in before I proved to myself I could sustain the effort. August and September 2015 were a flurry of set-up and recordings, and we opened our podcast doors -- virtually -- in October 2015. Since then, we’ve published a new episode weekly without fail.\r\n<h3><strong>6. Prepare to become a podcast promoter.</strong></h3>\r\nYour target personas won’t find your podcast without a little help, so promote it like your life depends on it. I utilized our company’s email list, my personal social channels, and myriad other platforms. In addition, I requested that each guest promote his or her episode.\r\n\r\nWe were fortunate to get on iTunes New and Noteworthy, landing us in the top five of several of its subject-specific lists during our first month.\r\n<h3><strong>7. Learn how to monetize your podcast.</strong></h3>\r\nFinally, it’s important to figure out how to earn an income based on your podcasting. One way is to promote your book, workshop, or online course, creating thought leadership at the same time.\r\n\r\nIf you have a narrow audience lacking depth or width and you just can’t sell advertisements or sponsorships, you can still make numbers work in your favor.\r\n\r\nSound like hard work? It is, but it’s totally worth it if you strategize. Two years after unveiling my first episode, we have 110 five-star reviews, and episodes are downloaded in more than 125 countries. I’m pleased to say we’ve also earned a presenting sponsorship from HubSpot. Podcasting hasn’t just been a feeder for the business, but a phenomenal marketing opportunity as well.\r\n\r\nHave you thought about taking the podcasting plunge? The water’s a bit choppy at first, but there’s plenty of room for another swimmer!\r\n\r\n</div>','Everything You Need to Know About Starting a Podcast in 2018','','publish','open','open','','everything-you-need-to-know-about-starting-a-podcast-in-2018','','','2018-01-09 21:12:59','2018-01-09 21:12:59','',0,'http://64.207.144.221/~lemontree/?p=12880',0,'post','',0),(12881,1,'2017-12-26 16:44:38','2017-12-26 16:44:38','','blog1','','inherit','open','closed','','blog1','','','2017-12-26 16:44:38','2017-12-26 16:44:38','',12880,'http://64.207.144.221/~lemontree/wp-content/uploads/2017/12/blog1.png',0,'attachment','image/png',0),(12882,1,'2017-12-26 16:44:39','2017-12-26 16:44:39','','blog2','','inherit','open','closed','','blog2','','','2017-12-26 16:44:39','2017-12-26 16:44:39','',12880,'http://64.207.144.221/~lemontree/wp-content/uploads/2017/12/blog2.png',0,'attachment','image/png',0),(12883,1,'2017-12-26 16:44:41','2017-12-26 16:44:41','','blog3','','inherit','open','closed','','blog3','','','2017-12-26 16:44:41','2017-12-26 16:44:41','',12880,'http://64.207.144.221/~lemontree/wp-content/uploads/2017/12/blog3.png',0,'attachment','image/png',0),(12884,1,'2017-12-26 16:44:43','2017-12-26 16:44:43','','blog4','','inherit','open','closed','','blog4','','','2017-12-26 16:44:43','2017-12-26 16:44:43','',12880,'http://64.207.144.221/~lemontree/wp-content/uploads/2017/12/blog4.png',0,'attachment','image/png',0),(12885,1,'2017-12-26 16:44:44','2017-12-26 16:44:44','','blog5','','inherit','open','closed','','blog5','','','2017-12-26 16:44:44','2017-12-26 16:44:44','',12880,'http://64.207.144.221/~lemontree/wp-content/uploads/2017/12/blog5.png',0,'attachment','image/png',0),(12886,1,'2017-12-26 16:44:47','2017-12-26 16:44:47','','blog6','','inherit','open','closed','','blog6','','','2017-12-26 16:44:47','2017-12-26 16:44:47','',12880,'http://64.207.144.221/~lemontree/wp-content/uploads/2017/12/blog6.png',0,'attachment','image/png',0),(12887,1,'2017-12-26 16:44:51','2017-12-26 16:44:51','','blog7','','inherit','open','closed','','blog7','','','2017-12-26 16:44:51','2017-12-26 16:44:51','',12880,'http://64.207.144.221/~lemontree/wp-content/uploads/2017/12/blog7.png',0,'attachment','image/png',0),(12888,1,'2017-12-26 16:45:09','2017-12-26 16:45:09','At vero eos et accusamus et iusto odios unsip dignissimos ducimus qui blan ditiis prasixers esentium voluptatum un deleniti atquestepi sites excep non providentsim ...At vero eos et accusamus et iusto odios unsip dignissimos ducimus qui blan ditiis prasixers esentium voluptatum un deleniti atquestepi sites excep non providentsim ...At vero eos et accusamus et iusto odios unsip dignissimos ducimus qui blan ditiis prasixers esentium voluptatum un deleniti atquestepi sites excep non providentsim ...At vero eos et accusamus et iusto odios unsip dignissimos ducimus qui blan ditiis prasixers esentium voluptatum un deleniti atquestepi sites excep non providentsim ...','Lorem Ipsums Un Voluptas Nemis Fugiat Un','','inherit','closed','closed','','12880-revision-v1','','','2017-12-26 16:45:09','2017-12-26 16:45:09','',12880,'http://64.207.144.221/~lemontree/index.php/2017/12/26/12880-revision-v1/',0,'revision','',0),(12889,1,'2017-12-26 16:49:52','2017-12-26 16:49:52','A whopping number of emails hit your subscribers’ inboxes each day. With so much competition for attention, it’s inevitable that a percentage of your subscriber list will lose interest in and stop engaging with your email marketing campaigns. It may not seem like a huge deal, but as a great percentage of your list stops engaging, the greater the risk you run of damaging your sender reputation and your email deliverability rates.\r\n\r\nSo, how can you address this issue? By creating special re-engagement emails targeted directly at your “inactive” subscribers.\r\n\r\n<strong>Re-engagement emails play a vital role in the email lifecycle</strong>\r\n\r\nMarketing Sherpa reports that, on average, <a href=\"https://www.hubspot.com/database-decay\" target=\"_blank\" rel=\"noopener\">marketers lose 25% of their email list each year (simply to attrition)</a>. Therefore, list retention should be an absolute must for all email marketers.\r\n\r\nWhen done well, re-engagement emails can reduce list churn rates and boost incremental engagement. In terms of deliverability, re-engaging your inactive subscribers can enhance or at least help you maintain inbox placement rates for your emails. Often, if your overall engagement levels drop significantly, ISPs are more likely to consider you a low-quality sender, block, and make your engagement problems even worse.\r\n\r\nSo what does an effective re-engagement email look like? Here are 10 examples to inspire your next campaign effort.\r\n<h2><strong>10 Re-engagement Email Examples to Woo the Inactive Subscribers</strong></h2>\r\n<h3><strong>1. Lowe’s</strong></h3>\r\nThis re-engagement email draws attention to the improvements in their products since the last subscriber engagement. They have tactfully highlighted how more than 5 million members are using their services. Social sharing buttons are clearly visible in the email footer -- hoping to push more engagement in other channels as well.\r\n<div><span class=\"pinContainer\"><img id=\"image1\" class=\"pinable\" title=\"C:UsersDisha BhattPicturesReengageimprovements-lowe\'s.jpg\" src=\"https://lh4.googleusercontent.com/5LnWSFng_fNLxPzTfX-oBkZQA1Xbrb5YPCSm1KwQRFu5bwdgATXyV9PTNhEjmddjqasc0JHcGNaNo2nwyGo6ae8-gMKt-oMJjMkIbU09prOo_0_X1wcInnA8qe9ne4-3KBCgaBs4lJ1Mt_u7rw\" data-pre-sourced=\"yes\" data-sourced=\"yes\" data-original=\"https://lh4.googleusercontent.com/5LnWSFng_fNLxPzTfX-oBkZQA1Xbrb5YPCSm1KwQRFu5bwdgATXyV9PTNhEjmddjqasc0JHcGNaNo2nwyGo6ae8-gMKt-oMJjMkIbU09prOo_0_X1wcInnA8qe9ne4-3KBCgaBs4lJ1Mt_u7rw\" data-src=\"https://lh4.googleusercontent.com/5LnWSFng_fNLxPzTfX-oBkZQA1Xbrb5YPCSm1KwQRFu5bwdgATXyV9PTNhEjmddjqasc0JHcGNaNo2nwyGo6ae8-gMKt-oMJjMkIbU09prOo_0_X1wcInnA8qe9ne4-3KBCgaBs4lJ1Mt_u7rw\" data-image-enhancer=\"larger than third of 645\" /></span></div>\r\n<h3><strong>2. Animoto</strong></h3>\r\nAnimoto sends out a simple question: Do you still want to hear from us? Their focus is on allowing subscribers to update their email preferences through a prominent CTA button that directs them to a preference center.\r\n<div><span class=\"pinContainer\"><img id=\"image2\" class=\"pinable\" title=\"C:UsersDisha BhattPicturesReengageAnimoto-did-you-still-want-to-hear-from-us.png\" src=\"https://lh4.googleusercontent.com/odTdZ2ALKSVgmCqIC4NttAeScG9F1RCPC7fNI1-hC3gAsMPpZzETcZwrz6qH77bIRc54WHEFLAVNmh1JgSi1yFv2lCFAKOPhcHzk1RHJMDGmcgwemIGPJmJPvwUGFg4KMQ2SUHV7CoED2-lEGg\" data-pre-sourced=\"yes\" data-sourced=\"yes\" data-original=\"https://lh4.googleusercontent.com/odTdZ2ALKSVgmCqIC4NttAeScG9F1RCPC7fNI1-hC3gAsMPpZzETcZwrz6qH77bIRc54WHEFLAVNmh1JgSi1yFv2lCFAKOPhcHzk1RHJMDGmcgwemIGPJmJPvwUGFg4KMQ2SUHV7CoED2-lEGg\" data-src=\"https://lh4.googleusercontent.com/odTdZ2ALKSVgmCqIC4NttAeScG9F1RCPC7fNI1-hC3gAsMPpZzETcZwrz6qH77bIRc54WHEFLAVNmh1JgSi1yFv2lCFAKOPhcHzk1RHJMDGmcgwemIGPJmJPvwUGFg4KMQ2SUHV7CoED2-lEGg\" data-image-enhancer=\"larger than 645\" /></span></div>\r\n<h3><strong>3. BirchBox</strong></h3>\r\nWe all love surprises. BirchBox makes use of that emotional instinct in their re-engagement emails. They provide subscribers with two interesting options -- a very rewarding way to re-engage!\r\n<div><span class=\"pinContainer\"><img id=\"image3\" class=\"pinable\" title=\"C:UsersDisha BhattPicturesReengagebirchbox.png\" src=\"https://lh5.googleusercontent.com/ye4fXMBiZOa_Kw-MdbEllEPs5GpnycqfP_qRsGt8Vwm7b3SMp4KKzFiq9TEyJpD8RLobeRIdo9GxcOvSAybXm3tCCG_3vEqqCvXd4pevQPHrUUMn1aVSlzr4qNDCmb5COXBOFyrBUYfGpZmZCg\" data-pre-sourced=\"yes\" data-sourced=\"yes\" data-original=\"https://lh5.googleusercontent.com/ye4fXMBiZOa_Kw-MdbEllEPs5GpnycqfP_qRsGt8Vwm7b3SMp4KKzFiq9TEyJpD8RLobeRIdo9GxcOvSAybXm3tCCG_3vEqqCvXd4pevQPHrUUMn1aVSlzr4qNDCmb5COXBOFyrBUYfGpZmZCg\" data-src=\"https://lh5.googleusercontent.com/ye4fXMBiZOa_Kw-MdbEllEPs5GpnycqfP_qRsGt8Vwm7b3SMp4KKzFiq9TEyJpD8RLobeRIdo9GxcOvSAybXm3tCCG_3vEqqCvXd4pevQPHrUUMn1aVSlzr4qNDCmb5COXBOFyrBUYfGpZmZCg\" data-image-enhancer=\"larger than third of 645\" /></span></div>\r\n<h3><strong>4. Grammarly</strong></h3>\r\nGrammarly re-engages inactive subscribers by presenting them with a “Wrinkle in Time” badge. The prominent CTA button ‘GO’ tempts the users to use their service again. They also promote their premium version at the bottom of the email and hint at a special price as well.\r\n<div><span class=\"pinContainer\"><img id=\"image4\" class=\"pinable\" title=\"C:UsersDisha BhattPicturesReengageyou-ve-earned-a-new-badge.png\" src=\"https://lh4.googleusercontent.com/-dPkZ46QOw7-GBeI7HFDB3HhiBbFkDbtMRJh97RpW1AsMou9nHrWrTFwe5ndidUcOvPvns9Ezgbf2zUaPV6sfSjM1qRx1pJg5mWCdRcoB_OPqKEMH5I0ZDoeNNNjVbNGnalKvnzujKuSW5Ju5w\" data-pre-sourced=\"yes\" data-sourced=\"yes\" data-original=\"https://lh4.googleusercontent.com/-dPkZ46QOw7-GBeI7HFDB3HhiBbFkDbtMRJh97RpW1AsMou9nHrWrTFwe5ndidUcOvPvns9Ezgbf2zUaPV6sfSjM1qRx1pJg5mWCdRcoB_OPqKEMH5I0ZDoeNNNjVbNGnalKvnzujKuSW5Ju5w\" data-src=\"https://lh4.googleusercontent.com/-dPkZ46QOw7-GBeI7HFDB3HhiBbFkDbtMRJh97RpW1AsMou9nHrWrTFwe5ndidUcOvPvns9Ezgbf2zUaPV6sfSjM1qRx1pJg5mWCdRcoB_OPqKEMH5I0ZDoeNNNjVbNGnalKvnzujKuSW5Ju5w\" data-image-enhancer=\"larger than 645\" /></span></div>\r\n<h3><strong>5. Path</strong></h3>\r\nPath is a photo-editing app that showcases all their new features to entice inactive subscribers. The ‘Update Now’ CTA stands out and drives engagements by pushing subscribers to update their app.\r\n<div><span class=\"pinContainer\"><img id=\"image5\" class=\"pinable\" title=\"C:UsersDisha BhattPicturesReengagewhat-you-ve-missed-on-path.png\" src=\"https://lh4.googleusercontent.com/UF1K5FIg_9GmwrC3YF3jCEEzeFXgCAtLeZ4fL5lYz2B70TjLfRJj9klhWbi76-gZG85xWXj_kOU30xW1cyKR2JZaeIhCkSdDW6UtPke3XCINSGNbCt4p9FEX1lLbSn6GsNz0XTzajUpt_eUpqg\" data-pre-sourced=\"yes\" data-sourced=\"yes\" data-original=\"https://lh4.googleusercontent.com/UF1K5FIg_9GmwrC3YF3jCEEzeFXgCAtLeZ4fL5lYz2B70TjLfRJj9klhWbi76-gZG85xWXj_kOU30xW1cyKR2JZaeIhCkSdDW6UtPke3XCINSGNbCt4p9FEX1lLbSn6GsNz0XTzajUpt_eUpqg\" data-src=\"https://lh4.googleusercontent.com/UF1K5FIg_9GmwrC3YF3jCEEzeFXgCAtLeZ4fL5lYz2B70TjLfRJj9klhWbi76-gZG85xWXj_kOU30xW1cyKR2JZaeIhCkSdDW6UtPke3XCINSGNbCt4p9FEX1lLbSn6GsNz0XTzajUpt_eUpqg\" data-image-enhancer=\"larger than 645\" /></span></div>\r\n<h3><strong>6. ReturnPath</strong></h3>\r\nReturnPath builds a brief background for the re-engagement and allows the subscriber to choose the types of communications they wish to receive. They demonstrate how the preference center works and end the email with two cute illustrations accompanied with related CTA buttons for options for engagement.\r\n<div><span class=\"pinContainer\"><img id=\"image6\" class=\"pinable\" title=\"C:UsersDisha BhattPicturesReengageshould-we-stay-or-should-we-go.gif\" src=\"https://lh4.googleusercontent.com/Z3GcWKeJ_COLbKrbBGMe_yPApxDrQmq9gNUx6nKNcjo6P949908f1HXy5t-XCcmm7ocOf_50Ut0bwvqlcjC8r14A4ngfaM_dv4HSMA2nWoGap1Ea9KiNHI0X_ERuBArn3GQGWuY_qmuUahznNA\" data-pre-sourced=\"yes\" data-sourced=\"yes\" data-original=\"https://lh4.googleusercontent.com/Z3GcWKeJ_COLbKrbBGMe_yPApxDrQmq9gNUx6nKNcjo6P949908f1HXy5t-XCcmm7ocOf_50Ut0bwvqlcjC8r14A4ngfaM_dv4HSMA2nWoGap1Ea9KiNHI0X_ERuBArn3GQGWuY_qmuUahznNA\" data-src=\"https://lh4.googleusercontent.com/Z3GcWKeJ_COLbKrbBGMe_yPApxDrQmq9gNUx6nKNcjo6P949908f1HXy5t-XCcmm7ocOf_50Ut0bwvqlcjC8r14A4ngfaM_dv4HSMA2nWoGap1Ea9KiNHI0X_ERuBArn3GQGWuY_qmuUahznNA\" data-image-enhancer=\"larger than 645\" /></span></div>\r\n<h3><strong>7. SurfStitch</strong></h3>\r\nThis re-engagement email attempts to feature everything that an inactive subscriber might have missed. They include a provision for the subscriber to adjust email frequency. And they don’t miss out on this opportunity to remind subscribers of their value propositions at the bottom (free express delivery, return policy, and customer service).\r\n<div><span class=\"pinContainer\"><img id=\"image7\" class=\"pinable\" title=\"C:UsersDisha BhattPicturesReengagereengagement-email-retail.jpg\" src=\"https://lh3.googleusercontent.com/IIg6EcwiTf4w-A-vj6foBvRuEsUMaMJMcvykRvZeUNdV5q4ZYuZPZAz_vVvHX1UiGz15sm9--NNTBshdnPKlGKiTMpc5BBqNDpNjjAabRZDGzd0rdIFkq7LhIQUjDDgdYJ4A2oyNyz4iNU-DSg\" data-pre-sourced=\"yes\" data-sourced=\"yes\" data-original=\"https://lh3.googleusercontent.com/IIg6EcwiTf4w-A-vj6foBvRuEsUMaMJMcvykRvZeUNdV5q4ZYuZPZAz_vVvHX1UiGz15sm9--NNTBshdnPKlGKiTMpc5BBqNDpNjjAabRZDGzd0rdIFkq7LhIQUjDDgdYJ4A2oyNyz4iNU-DSg\" data-src=\"https://lh3.googleusercontent.com/IIg6EcwiTf4w-A-vj6foBvRuEsUMaMJMcvykRvZeUNdV5q4ZYuZPZAz_vVvHX1UiGz15sm9--NNTBshdnPKlGKiTMpc5BBqNDpNjjAabRZDGzd0rdIFkq7LhIQUjDDgdYJ4A2oyNyz4iNU-DSg\" data-image-enhancer=\"larger than third of 645\" /></span></div>\r\n<h3><strong>8. Urban Outfitters</strong></h3>\r\nThis re-engagement email by Urban Outfitters is a perfect blend of humor and emotional appeal. It’s brand-appropriate, and likely stands out very well from their normal marketing emails.\r\n<div><span class=\"pinContainer\"><img id=\"image8\" class=\"pinable\" title=\"C:UsersDisha BhattPicturesReengagere-engagement email- urban outfitters.jpg\" src=\"https://lh6.googleusercontent.com/kExkKybndRKxzRfF04qENJT5aec99Wy1Y3SR7EHacfDuoiXF1jn5C293F9_SzhzMCBzf4n2E0WtC34dccVT5fEkBY3n_NqpdaA7AgTQV0hZqiHwwT3iVSbEF7GFx01d_FsuZUh9dweseJxa3NQ\" data-pre-sourced=\"yes\" data-sourced=\"yes\" data-original=\"https://lh6.googleusercontent.com/kExkKybndRKxzRfF04qENJT5aec99Wy1Y3SR7EHacfDuoiXF1jn5C293F9_SzhzMCBzf4n2E0WtC34dccVT5fEkBY3n_NqpdaA7AgTQV0hZqiHwwT3iVSbEF7GFx01d_FsuZUh9dweseJxa3NQ\" data-src=\"https://lh6.googleusercontent.com/kExkKybndRKxzRfF04qENJT5aec99Wy1Y3SR7EHacfDuoiXF1jn5C293F9_SzhzMCBzf4n2E0WtC34dccVT5fEkBY3n_NqpdaA7AgTQV0hZqiHwwT3iVSbEF7GFx01d_FsuZUh9dweseJxa3NQ\" data-image-enhancer=\"larger than third of 645\" /></span></div>\r\n<h3><strong>9. Paul Mitchell</strong></h3>\r\nPaul Mitchell starts off their re-engagement email with an emotional ‘We hate goodbyes,’ informing the subscriber that it’s the last email to them. They include their products in a sad or worried face and drive readers prominently to a CTA to stay subscribed.\r\n<div><span class=\"pinContainer\"><img id=\"image9\" class=\"pinable\" title=\"C:UsersDisha BhattPicturesReengagere-engage email.png\" src=\"https://lh6.googleusercontent.com/vcqDaKKzaN4CGP_h6yTnShNY8WUpC0dtLrsnrqPTCeMiZwm-rpscsdcJLSTqGMEzWGEOGgg3lacOZ7L4dGqCNS71thnZ9MqGPjA8frD6zNx3ZIAMpLrimRFKipGMSqFxiM9vXKwsTFs8kpd7sw\" data-pre-sourced=\"yes\" data-sourced=\"yes\" data-original=\"https://lh6.googleusercontent.com/vcqDaKKzaN4CGP_h6yTnShNY8WUpC0dtLrsnrqPTCeMiZwm-rpscsdcJLSTqGMEzWGEOGgg3lacOZ7L4dGqCNS71thnZ9MqGPjA8frD6zNx3ZIAMpLrimRFKipGMSqFxiM9vXKwsTFs8kpd7sw\" data-src=\"https://lh6.googleusercontent.com/vcqDaKKzaN4CGP_h6yTnShNY8WUpC0dtLrsnrqPTCeMiZwm-rpscsdcJLSTqGMEzWGEOGgg3lacOZ7L4dGqCNS71thnZ9MqGPjA8frD6zNx3ZIAMpLrimRFKipGMSqFxiM9vXKwsTFs8kpd7sw\" data-image-enhancer=\"larger than third of 645\" /></span></div>\r\n<h3><strong>10. Asthma Foundation</strong></h3>\r\nNon-profit organizations can use re-engagement emails effectively as well -- especially when it comes to convincing previous donors to demonstrate their generosity once more. This email by the Asthma Foundation deftly illustrates asthma triggers and quickly goes into persuasion mode to get the subscriber to make another contribution.\r\n<div><span class=\"pinContainer\"><img id=\"image10\" class=\"pinable\" title=\"C:UsersDisha BhattPicturesReengagenonprofit-asthma.jpg\" src=\"https://lh4.googleusercontent.com/wfFpVwl_ZO1gnBHp4RwSTP5XMVHHy-O5jFf29OjS1PS27Vta5LpTCN61cZYTA6_sOWLa0t9IPRfEKHBd5Vf0-SqRNsYkJ_Ua2ZyZyDXBb98ZrJGOYLO1lJJlWZa00d-e0mVvBg26WXqTJiUgxw\" data-pre-sourced=\"yes\" data-sourced=\"yes\" data-original=\"https://lh4.googleusercontent.com/wfFpVwl_ZO1gnBHp4RwSTP5XMVHHy-O5jFf29OjS1PS27Vta5LpTCN61cZYTA6_sOWLa0t9IPRfEKHBd5Vf0-SqRNsYkJ_Ua2ZyZyDXBb98ZrJGOYLO1lJJlWZa00d-e0mVvBg26WXqTJiUgxw\" data-src=\"https://lh4.googleusercontent.com/wfFpVwl_ZO1gnBHp4RwSTP5XMVHHy-O5jFf29OjS1PS27Vta5LpTCN61cZYTA6_sOWLa0t9IPRfEKHBd5Vf0-SqRNsYkJ_Ua2ZyZyDXBb98ZrJGOYLO1lJJlWZa00d-e0mVvBg26WXqTJiUgxw\" data-image-enhancer=\"larger than 645\" /></span></div>\r\n&nbsp;\r\n<h3>Get ready to re-engage.</h3>\r\nSubscriber inactivity is a fact of life. How you handle it makes all the difference. Take these subscribers as an opportunity to try new content and innovative approaches to see how you can bring your old customers back and get you new sales.','10 Examples of Effective Re-Engagement Emails','','publish','open','open','','10-examples-of-effective-re-engagement-emails','','','2018-01-09 21:09:49','2018-01-09 21:09:49','',0,'http://64.207.144.221/~lemontree/?p=12889',0,'post','',0),(12890,1,'2017-12-26 16:49:52','2017-12-26 16:49:52','At vero eos et accusamus et iusto odios unsip dignissimos ducimus qui blan ditiis prasixers esentium voluptatum un deleniti atquestepi sites excep non providentsim ...At vero eos et accusamus et iusto odios unsip dignissimos ducimus qui blan ditiis prasixers esentium voluptatum un deleniti atquestepi sites excep non providentsim ...At vero eos et accusamus et iusto odios unsip dignissimos ducimus qui blan ditiis prasixers esentium voluptatum un deleniti atquestepi sites excep non providentsim ...At vero eos et accusamus et iusto odios unsip dignissimos ducimus qui blan ditiis prasixers esentium voluptatum un deleniti atquestepi sites excep non providentsim ...','At vero eos et accusamus et iusto odios','','inherit','closed','closed','','12889-revision-v1','','','2017-12-26 16:49:52','2017-12-26 16:49:52','',12889,'http://64.207.144.221/~lemontree/index.php/2017/12/26/12889-revision-v1/',0,'revision','',0),(12891,1,'2017-12-26 16:50:34','2017-12-26 16:50:34','The way we ask for recommendations has evolved.\r\n\r\nWhereas once upon a time we may have asked a neighbor to recommend a product or service, <a href=\"https://www.bizjournals.com/bizjournals/how-to/marketing/2015/05/how-social-media-influences-consumer-buying.html\" target=\"_blank\" rel=\"noopener\">47% of millennials</a> now turn to social media for recommendations and reviews before deciding on a purchase.\r\n\r\nBut these consumers aren’t <em>always</em> going to the social media accounts of brands. Much of the time, they\'re visiting the profiles of a special breed of social media personalities: influencers.\r\n\r\nConsider this: Close to <a href=\"https://blog.twitter.com/marketing/en_us/a/2016/new-research-the-value-of-influencers-on-twitter.html\" target=\"_blank\" rel=\"noopener\">40% of Twitter users alone have made a purchase as a result of influencer marketing</a> -- and that\'s excluding the influence, if you will, of personalities on other channels, like Instagram.\r\n\r\nAnd when we think of influencers, for many of us, A-list personalities and celebrities come to mind. Take Kylie Jenner, for example, who helped catapult the brand Fashion Nova into a favorite online retail brand.\r\n<blockquote>\r\n<div>\r\n<div></div>\r\n<a href=\"https://www.instagram.com/p/BOhlX_IBeIn/\" target=\"_blank\" rel=\"noopener\">#ad Obsessed with my new @fashionnova jeans ?Get them at FashionNova.com ?</a>\r\n\r\nA post shared by Kylie (@kyliejenner) on Dec 27, 2016 at 6:57am PST\r\n\r\n</div></blockquote>\r\nSure, celebrities might significantly help boost your sales and achieve your marketing goals. But let’s face it: most of us can\'t afford their price tags. After all, it’s reported that <a href=\"http://www.huffingtonpost.co.uk/entry/revealed-how-much-celebs-earn-per-instagram-post-including-kim-kardashian-and-zoella_uk_59562c00e4b0da2c7322c11d\" target=\"_blank\" rel=\"noopener\">Kylie Jenner gets $400,000</a> for a single promotional Instagram post.\r\n\r\nThe good news is that marketers and startup business owners now have another option that will allow them to tap into the power of influencer marketing without putting their ROI in jeopardy.\r\n\r\nThis option comes in the form of a unique group of social media users collectively known as micro-influencers.\r\n<div>\r\n<h2>What Is a Micro-Influencer?</h2>\r\nMicro-influencers are social media users -- unlike typical celebrities, experts, or public figures. They\'re individuals who work or specialize in a particular vertical and frequently share social media content about their interests. Unlike traditional \"influencers,\" micro-influencers have a more modest number of followers -- typically in the thousands or tens of thousands -- but they boast hyper-engaged audiences.\r\n\r\n</div>\r\n<h3>Why Use Micro-Influencers?</h3>\r\nAt first, opting to use micro-influencers for your marketing campaign may sound counterintuitive. Would it be more beneficial to tap an influencer with millions of followers, as opposed to getting a micro-influencer with just a few thousand followers?\r\n\r\nNot necessarily.\r\n\r\nThat’s because when it comes to influencer marketing, the level of engagement is more crucial. It is one of the <a href=\"http://offers.kevintpayne.com/blog/influencer-marketing-strategy\" target=\"_blank\" rel=\"noopener\">key metrics</a> that will help you gauge the effectiveness of your influencer marketing campaign.\r\n\r\nIn a study done by <a href=\"http://markerly.com/blog/instagram-marketing-does-influencer-size-matter/\" target=\"_blank\" rel=\"noopener\">Markerly</a>, a converse relationship was discovered between the number of followers an influencer has, and the level of engagement each post gets. In other words, as the number of followers increases, the engagement rate decreases.\r\n<div><span class=\"pinContainer\"><img id=\"image1\" class=\"pinable\" title=\"Macintosh HD:Users:adeleyuboco:Downloads:Screen-Shot-2016-04-11-at-3.44.27-PM.png\" src=\"https://lh6.googleusercontent.com/tVPFwOK1NTApnE0GOU78NJk6-o6F85kv0fJaaQOSnfH23wDDcXytuIfGSI0dZq-pMTYlO8EVPcnU0_NAgvyGFnFEd8WxnGZYUjLHmexQ23jBEOS-WMELP6Swj6-chcOouq0gfduYPSFimN-ffQ\" data-pre-sourced=\"yes\" data-sourced=\"yes\" data-original=\"https://lh6.googleusercontent.com/tVPFwOK1NTApnE0GOU78NJk6-o6F85kv0fJaaQOSnfH23wDDcXytuIfGSI0dZq-pMTYlO8EVPcnU0_NAgvyGFnFEd8WxnGZYUjLHmexQ23jBEOS-WMELP6Swj6-chcOouq0gfduYPSFimN-ffQ\" data-src=\"https://lh6.googleusercontent.com/tVPFwOK1NTApnE0GOU78NJk6-o6F85kv0fJaaQOSnfH23wDDcXytuIfGSI0dZq-pMTYlO8EVPcnU0_NAgvyGFnFEd8WxnGZYUjLHmexQ23jBEOS-WMELP6Swj6-chcOouq0gfduYPSFimN-ffQ\" data-image-enhancer=\"larger than third of 645\" /></span></div>\r\n<div><span class=\"pinContainer\"><img id=\"image2\" class=\"pinable\" title=\"Macintosh HD:Users:adeleyuboco:Downloads:Screen-Shot-2016-04-11-at-3.44.59-PM.png\" src=\"https://lh4.googleusercontent.com/psQKmwzAvEg5uNi7JJxzT6kifG7of89norIWfWeLiS_ALJMC6Avc56xUScrASLoGRIS5_n217MAMmtt5Q7ATlQ-jNuoaEx4OWjkfsYKJdMxd7PQiZiKlsJJGcPlQtPEQiHPlGkqAeXhdyOYYhg\" data-pre-sourced=\"yes\" data-sourced=\"yes\" data-original=\"https://lh4.googleusercontent.com/psQKmwzAvEg5uNi7JJxzT6kifG7of89norIWfWeLiS_ALJMC6Avc56xUScrASLoGRIS5_n217MAMmtt5Q7ATlQ-jNuoaEx4OWjkfsYKJdMxd7PQiZiKlsJJGcPlQtPEQiHPlGkqAeXhdyOYYhg\" data-src=\"https://lh4.googleusercontent.com/psQKmwzAvEg5uNi7JJxzT6kifG7of89norIWfWeLiS_ALJMC6Avc56xUScrASLoGRIS5_n217MAMmtt5Q7ATlQ-jNuoaEx4OWjkfsYKJdMxd7PQiZiKlsJJGcPlQtPEQiHPlGkqAeXhdyOYYhg\" data-image-enhancer=\"larger than third of 645\" /></span></div>\r\n<div><em>Source: <a href=\"http://markerly.com/blog/instagram-marketing-does-influencer-size-matter/\" target=\"_blank\" rel=\"noopener\">Markerly</a></em></div>\r\nIn its own study, <a href=\"https://www.experticity.com/new-research-shows-micro-influencers-drive-consumer-buying-behavior-much-higher-rates-previously-thought/\" target=\"_blank\" rel=\"noopener\">Expercity</a> found that micro-influencers not only generate 22.2X more conversion than the average social media user, but that 74% of them are rather direct in encouraging their followers to buy or try a product or service they\'re endorsing. That communicates credibility and transparency, which can help to build a loyal following.\r\n\r\nCost is another reason why many brands are now turning to micro-influencers. According to a study done by <a href=\"https://activate.bloglovin.com/docs/whitepaper/Bloglovin_Global_Influencer_Survey_2016.pdf\" target=\"_blank\" rel=\"noopener\">Bloglovin’</a>, 97% of micro-influencers charge $500 and below for a sponsored post on Instagram.\r\n<div><span class=\"pinContainer\"><img id=\"image3\" class=\"pinable\" title=\"Macintosh HD:Users:adeleyuboco:Downloads:1*SoYJLiz3vcTbEIGL8GTnLg.png\" src=\"https://lh3.googleusercontent.com/w-r4H1nwOo7Mm1W59W17zw7wZ1cTi3jBDXib8oK6swKyyIAFkCRLT4PdrdBCCvdAqjyGSHBnfeFBRM8qW-q3dCzlJKkc0sxZakQh-44WnH0ch4bk8AiIkMvpnfNaeMRnhYRGmkvwZjBkNYGbuQ\" data-pre-sourced=\"yes\" data-sourced=\"yes\" data-original=\"https://lh3.googleusercontent.com/w-r4H1nwOo7Mm1W59W17zw7wZ1cTi3jBDXib8oK6swKyyIAFkCRLT4PdrdBCCvdAqjyGSHBnfeFBRM8qW-q3dCzlJKkc0sxZakQh-44WnH0ch4bk8AiIkMvpnfNaeMRnhYRGmkvwZjBkNYGbuQ\" data-src=\"https://lh3.googleusercontent.com/w-r4H1nwOo7Mm1W59W17zw7wZ1cTi3jBDXib8oK6swKyyIAFkCRLT4PdrdBCCvdAqjyGSHBnfeFBRM8qW-q3dCzlJKkc0sxZakQh-44WnH0ch4bk8AiIkMvpnfNaeMRnhYRGmkvwZjBkNYGbuQ\" data-image-enhancer=\"larger than 645\" /></span></div>\r\n<em>Source: <a href=\"https://influence.bloglovin.com/how-much-does-micro-influencer-marketing-cost-8bace128ca75\" target=\"_blank\" rel=\"noopener\">Influence</a></em>\r\n\r\nAdditionally, 87% micro-influencers charge $500 and below for a sponsored blog post.\r\n<div><span class=\"pinContainer\"><img id=\"image4\" class=\"pinable\" title=\"Macintosh HD:Users:adeleyuboco:Downloads:1*Wmgc1Mj6lG-zPqEU_2Gb3w.png\" src=\"https://lh4.googleusercontent.com/k3RCUzgqq_DyUoxWVaO62o5FVm0vavbUqQm5ooYJHvuH4q9gU9NMe2LU8r_afN6aRwV5mRB-3p-nr3DIcLCOxc1PPA7eDjE4HqN1cv7n6hk7Oj91_sEEmJSfdEcXjRdVBQKBGwO7Z1jtdZcFmA\" data-pre-sourced=\"yes\" data-sourced=\"yes\" data-original=\"https://lh4.googleusercontent.com/k3RCUzgqq_DyUoxWVaO62o5FVm0vavbUqQm5ooYJHvuH4q9gU9NMe2LU8r_afN6aRwV5mRB-3p-nr3DIcLCOxc1PPA7eDjE4HqN1cv7n6hk7Oj91_sEEmJSfdEcXjRdVBQKBGwO7Z1jtdZcFmA\" data-src=\"https://lh4.googleusercontent.com/k3RCUzgqq_DyUoxWVaO62o5FVm0vavbUqQm5ooYJHvuH4q9gU9NMe2LU8r_afN6aRwV5mRB-3p-nr3DIcLCOxc1PPA7eDjE4HqN1cv7n6hk7Oj91_sEEmJSfdEcXjRdVBQKBGwO7Z1jtdZcFmA\" data-image-enhancer=\"larger than 645\" /></span></div>\r\n<div><em>Source: <a href=\"https://influence.bloglovin.com/how-much-does-micro-influencer-marketing-cost-8bace128ca75\" target=\"_blank\" rel=\"noopener\">Influence</a></em></div>\r\n<h3>Finding the Right Micro-Influencer for Your Business</h3>\r\nWith so many micro-influencers out there, it’s no surprise that <a href=\"https://econsultancy.com/blog/67555-the-three-biggest-challenges-in-influencer-marketing/\" target=\"_blank\" rel=\"noopener\">73% of marketers</a> point to finding the right one as one of their biggest challenges.\r\n<div><img id=\"image5\" title=\"Macintosh HD:Users:adeleyuboco:Downloads:Screen_Shot_2016-02-22_at_16.01.41.png\" src=\"https://lh6.googleusercontent.com/ta5oAhIoDJuRoK8hI-Oms3KnBSmYLOSNa1ILTxBTwXLAIMRqoaMWUC2pvhHJxo4G28bBiND-5h0tffPDrMAByWW6hDYyMpQoMVrkITSVXvnx1HSqNic45-amo08I89uYNRoLrcSD89gkpIVz3Q\" data-pre-sourced=\"yes\" data-sourced=\"yes\" data-original=\"https://lh6.googleusercontent.com/ta5oAhIoDJuRoK8hI-Oms3KnBSmYLOSNa1ILTxBTwXLAIMRqoaMWUC2pvhHJxo4G28bBiND-5h0tffPDrMAByWW6hDYyMpQoMVrkITSVXvnx1HSqNic45-amo08I89uYNRoLrcSD89gkpIVz3Q\" data-src=\"https://lh6.googleusercontent.com/ta5oAhIoDJuRoK8hI-Oms3KnBSmYLOSNa1ILTxBTwXLAIMRqoaMWUC2pvhHJxo4G28bBiND-5h0tffPDrMAByWW6hDYyMpQoMVrkITSVXvnx1HSqNic45-amo08I89uYNRoLrcSD89gkpIVz3Q\" data-image-enhancer=\"larger than third of 645\" /></div>\r\n<em>Source: <a href=\"https://econsultancy.com/blog/67555-the-three-biggest-challenges-in-influencer-marketing/\" target=\"_blank\" rel=\"noopener\">Econsultancy</a></em>\r\n\r\nOf course, you can choose to hire an influencer marketing agency to help you find the right micro-influencers for your campaign. But if you want to be more hands-on in finding the right micro-influencer, here are seven questions you’ll need to answer very carefully.\r\n<h4>1. What are your goals?</h4>\r\nThe first thing to consider when finding the right micro-influencer is to look at what you\'re aiming to achieve. Do you want to generate more leads for your business? If so, look for micro-influencers that frequently host contests or giveaways on their social media accounts -- especially if they involve encouraging their followers to sign up in exchange for free trials, products or access to an exclusive event.\r\n<h4>2. Who are the micro-influencer\'s followers?</h4>\r\nWhen reviewing the followers of the micro-influencer you want to reach, look at to how well they align with your brand\'s buyer personas. Some of the things to consider are:\r\n<ul>\r\n 	<li>Where are the majority of the micro-influencers\' followers based (geographically)?</li>\r\n 	<li>Are they mostly male or female?</li>\r\n 	<li>Which type of posts resonates with them the most?</li>\r\n</ul>\r\n<h4>3. Is the micro-influencer already a fan?</h4>\r\nWorking with a micro-influencer that’s already using your product or service has several benefits. For starters, he or she might already be posting about your company and products -- so a partnership is more natural and appears more genuine to followers.\r\n\r\nAlso, micro-influencers who are fans of your products and brand are more likely negotiate lower fees. Some may even be willing to collaborate with you in exchange for some free products or services.\r\n\r\nOne way to find these micro-influencers is to perform a general search for blog posts mentioning your brand. Since Google ranks sites based on content quality, there\'s a good chance that the first two or three results belong to a micro-influencer in your niche.\r\n\r\nAnother is by using a tool like <a href=\"http://gatsby.ai/\" target=\"_blank\" rel=\"noopener\">Gatsby.ai</a> (which has an integration with HubSpot) to your website. Gatsby helps you search through your customer database for micro-influencers that have bought your products, and help you quickly retrieve their information so that you can reach out to them.\r\n<div><span class=\"pinContainer\"><img id=\"image6\" class=\"pinable\" src=\"https://lh6.googleusercontent.com/dSuMvp4Q5tUBlRXnF-tgCYrBuwMdHzmQaAOZZpQHhD1UyklGHqg_B6r6CxAl04aU6kwTs7wO4QsUjSjOvETM3fMcWTeiLf7zcfdrBgNWf5lE6tmLBwSEOOT6Lc88VMDPXPGyo3gbv2i58Lw4bg\" data-pre-sourced=\"yes\" data-sourced=\"yes\" data-original=\"https://lh6.googleusercontent.com/dSuMvp4Q5tUBlRXnF-tgCYrBuwMdHzmQaAOZZpQHhD1UyklGHqg_B6r6CxAl04aU6kwTs7wO4QsUjSjOvETM3fMcWTeiLf7zcfdrBgNWf5lE6tmLBwSEOOT6Lc88VMDPXPGyo3gbv2i58Lw4bg\" data-src=\"https://lh6.googleusercontent.com/dSuMvp4Q5tUBlRXnF-tgCYrBuwMdHzmQaAOZZpQHhD1UyklGHqg_B6r6CxAl04aU6kwTs7wO4QsUjSjOvETM3fMcWTeiLf7zcfdrBgNWf5lE6tmLBwSEOOT6Lc88VMDPXPGyo3gbv2i58Lw4bg\" data-image-enhancer=\"larger than 645\" /></span></div>\r\n<h4>4. How engaged is the micro-influencer\'s audience?</h4>\r\nAs I mentioned earlier, a micro-influencer’s engagement rate is one of the key metrics that will help you determine the success (or lack of it) of your influencer marketing campaign.\r\n\r\nReview the social media accounts of the micro-influencer to see how many likes, comments, and shares each post gets. Although likes are good, I often recommend that my clients focus more on the number of comments and shares a post receives. That\'s because it requires more effort for a follower to leave a comment on or share a post than it is to click on the like button. Often, followers will only leave comments when they find the post compelling enough for them do so.\r\n<h4>5. What kind of content does the micro-influencer produce?</h4>\r\nMicro-influencers create their posts based on their own brand and image they want to convey to their followers and compare this against the image you want your audience to associate with your brand. There must be alignment between your perceived brand image the micro-influencer\'s, in order to ensure that the posts he or she creates for you don\'t look like a mismatch. Followers tend not to appreciate that -- after all, they follow this micro-influencer for relevant content.\r\n<h4>6. Are they working with your competitors?</h4>\r\nIf you\'re seriously considering using influencer marketing, there\'s a chance that your competitors are also doing the same. Take some time to review the posts of the micro-influencers you want to work with, and see if they\'ve worked with any of your direct or indirect competitors.\r\n\r\nIf so, how did the audience respond to the post? Was there anything mentioned by the micro-influencer about your competitors\' products that you can leverage?\r\n<h4>7. How many platforms do they use?</h4>\r\nAlthough <a href=\"https://activate.bloglovin.com/docs/whitepaper/Bloglovin_Global_Influencer_Survey_2016.pdf\" target=\"_blank\" rel=\"noopener\">80% of micro-influencers point to Instagram</a> as their preferred platform for creating and publishing content, many of them are equally active on their own blogs and in other social media channels. Some even have access to traditional media like TV and magazines. The more platforms a micro-influencer can use to promote your content, the better for you.','7 Questions to Ask Before Working With a Micro-Influencer','','publish','open','open','','7-questions-to-ask-before-working-with-a-micro-influencer','','','2018-01-09 21:14:45','2018-01-09 21:14:45','',0,'http://64.207.144.221/~lemontree/?p=12891',0,'post','',0),(12892,1,'2017-12-26 16:50:34','2017-12-26 16:50:34','At vero eos et accusamus et iusto odios unsip dignissimos ducimus qui blan ditiis prasixers esentium voluptatum un deleniti atquestepi sites excep non providentsim ...At vero eos et accusamus et iusto odios unsip dignissimos ducimus qui blan ditiis prasixers esentium voluptatum un deleniti atquestepi sites excep non providentsim ...At vero eos et accusamus et iusto odios unsip dignissimos ducimus qui blan ditiis prasixers esentium voluptatum un deleniti atquestepi sites excep non providentsim ...At vero eos et accusamus et iusto odios unsip dignissimos ducimus qui blan ditiis prasixers esentium voluptatum un deleniti atquestepi sites excep non providentsim ...','At vero eos et accusamus et iusto odios unsip','','inherit','closed','closed','','12891-revision-v1','','','2017-12-26 16:50:34','2017-12-26 16:50:34','',12891,'http://64.207.144.221/~lemontree/index.php/2017/12/26/12891-revision-v1/',0,'revision','',0),(12893,1,'2017-12-26 16:51:05','2017-12-26 16:51:05','With 2.2 billion active users, it might seem like turning followers into paying customers on Facebook would be easy. At least a few of those users will want what you’re selling ... right? Unfortunately, targeting a local market on Facebook is a little more challenging than that.\r\n\r\nBuilding a local Facebook marketing <a href=\"https://www.envision-creative.com/social-media-strategy-guide-for-epic-success/\" target=\"_blank\" rel=\"noopener\">strategy</a> is challenging, but extremely rewarding when executed correctly. Here are <strong>nine proven Facebook marketing tactics</strong> you can use to drive foot traffic, build brand awareness, and increase revenue potential.\r\n<h2>9 Tactics for Your Local Facebook Marketing Strategy</h2>\r\n<h3><strong>1. Share Reviews</strong></h3>\r\nStanding out can be difficult when you’re surrounded by hundreds of other businesses all vying for attention. The key often lies in using social proof. <strong>People trust businesses that can prove what they say is true -- </strong>especially if that proof comes from a customer.\r\n\r\n<strong>Here are two review tactics we use:</strong>\r\n<ul>\r\n 	<li>Share screenshots of positive reviews from other social sites.</li>\r\n 	<li>Ask customers to share the experience they’ve had with your business.</li>\r\n</ul>\r\nScreenshot positive reviews on sites like Yelp and Google+, and then share them on your Facebook page. Tag the reviewer’s business in your post with a sincere “<em>Thank you,”</em>, or just happily boast that you have the best customers. Sharing screenshots of emails from happy customers works too, just be sure you ask permission first.\r\n<div><span class=\"pinContainer\"><img id=\"image1\" class=\"pinable\" title=\"mage-1.png\" src=\"https://lh6.googleusercontent.com/JMH1m5J9z9Zv8pZsvXxNWJMqdtpGzBGmTiNevOm4ZxIUHzmK5wrMHLITXeYX14_V2WSKZHPFqvQpcko-PI1ijYxzF3clszo0CUdsutSc45lMBk6mJ68lpNAn-KekOG4mU2tNDDPT1Mv3_qRgVA\" data-pre-sourced=\"yes\" data-sourced=\"yes\" data-original=\"https://lh6.googleusercontent.com/JMH1m5J9z9Zv8pZsvXxNWJMqdtpGzBGmTiNevOm4ZxIUHzmK5wrMHLITXeYX14_V2WSKZHPFqvQpcko-PI1ijYxzF3clszo0CUdsutSc45lMBk6mJ68lpNAn-KekOG4mU2tNDDPT1Mv3_qRgVA\" data-src=\"https://lh6.googleusercontent.com/JMH1m5J9z9Zv8pZsvXxNWJMqdtpGzBGmTiNevOm4ZxIUHzmK5wrMHLITXeYX14_V2WSKZHPFqvQpcko-PI1ijYxzF3clszo0CUdsutSc45lMBk6mJ68lpNAn-KekOG4mU2tNDDPT1Mv3_qRgVA\" data-image-enhancer=\"larger than 645\" /></span></div>\r\nIf you’re just starting out and your business doesn’t have any reviews yet, <strong>give your audience an incentive to leave positive feedback</strong>. Ask your followers how their last experience was at your business. Offer a product giveaway to the first five people that leave a comment describing why they love your company. Even if you don’t get an official Facebook review, someone will probably comment on their experience. That’s social proof.\r\n<h3><strong>2. Create an Event</strong></h3>\r\nHaving a live band perform at your restaurant this weekend or throwing a big sale at your retail store? Facebook events are a great way to notify your followers and generate some buzz for your business. Even if people can\'t attend in person, it shows that your business is actively engaged with the community.\r\n\r\nCreating an event on your Facebook page is easy. First, navigate to the “Events” tab.\r\n<div><span class=\"pinContainer\"><img id=\"image2\" class=\"pinable\" src=\"https://lh4.googleusercontent.com/3Xeaa5MjWrcTB2M8r3L9d3kfb3rXDNK5paui2yYN-RWifIX0Dp4vLpJKewBI5u85mi_zF_DBB1TP6frbE1L43IuyLOLmxP2ZHkDcSZf6W5qO5mFK3Q3QxmpBfP4UfP5zwNkh6LnchrawcQHSEw\" data-pre-sourced=\"yes\" data-sourced=\"yes\" data-original=\"https://lh4.googleusercontent.com/3Xeaa5MjWrcTB2M8r3L9d3kfb3rXDNK5paui2yYN-RWifIX0Dp4vLpJKewBI5u85mi_zF_DBB1TP6frbE1L43IuyLOLmxP2ZHkDcSZf6W5qO5mFK3Q3QxmpBfP4UfP5zwNkh6LnchrawcQHSEw\" data-src=\"https://lh4.googleusercontent.com/3Xeaa5MjWrcTB2M8r3L9d3kfb3rXDNK5paui2yYN-RWifIX0Dp4vLpJKewBI5u85mi_zF_DBB1TP6frbE1L43IuyLOLmxP2ZHkDcSZf6W5qO5mFK3Q3QxmpBfP4UfP5zwNkh6LnchrawcQHSEw\" data-image-enhancer=\"larger than third of 645\" /></span></div>\r\nSelect the blue “Create Event” button.\r\n<div><span class=\"pinContainer\"><img id=\"image3\" class=\"pinable\" src=\"https://lh4.googleusercontent.com/C4FwdIDP3pFDuZ0kOwXUSLFsRSeCA7tnd9hf3YfXqiBiZfo44cHRufem3QGcd4I0egzd8MeAX1Q5ktFbkKNzsKrJsacisRJW0hPe1rFdcNxF11Fgcll_LHNKs2T4epP4joZj5oHuqnV2XzhobA\" data-pre-sourced=\"yes\" data-sourced=\"yes\" data-original=\"https://lh4.googleusercontent.com/C4FwdIDP3pFDuZ0kOwXUSLFsRSeCA7tnd9hf3YfXqiBiZfo44cHRufem3QGcd4I0egzd8MeAX1Q5ktFbkKNzsKrJsacisRJW0hPe1rFdcNxF11Fgcll_LHNKs2T4epP4joZj5oHuqnV2XzhobA\" data-src=\"https://lh4.googleusercontent.com/C4FwdIDP3pFDuZ0kOwXUSLFsRSeCA7tnd9hf3YfXqiBiZfo44cHRufem3QGcd4I0egzd8MeAX1Q5ktFbkKNzsKrJsacisRJW0hPe1rFdcNxF11Fgcll_LHNKs2T4epP4joZj5oHuqnV2XzhobA\" data-image-enhancer=\"larger than 645\" /></span></div>\r\nFill in the details:\r\n<ul>\r\n 	<li>Date and time</li>\r\n 	<li>Event category</li>\r\n 	<li>Event keywords</li>\r\n 	<li>A link to the ticketing website</li>\r\n</ul>\r\nFinally, add a compelling photo, and you’re good to go.\r\n<div><span class=\"pinContainer\"><img id=\"image4\" class=\"pinable\" title=\"mage-4.png\" src=\"https://lh4.googleusercontent.com/4XV5Cb2VDDNidpL-bGRSQRAlRJKXgoCggsYC43W9OT2pkgp7SpBzO1XM8bSRGKipPZ62TB2UzjG5jsY7x_qYJJ2RI5pQdYP52Ody7VRByGQ4-Fv5DudLlcWJgf5_aX1B0RXF3Wzhk8QHj3rXtw\" data-pre-sourced=\"yes\" data-sourced=\"yes\" data-original=\"https://lh4.googleusercontent.com/4XV5Cb2VDDNidpL-bGRSQRAlRJKXgoCggsYC43W9OT2pkgp7SpBzO1XM8bSRGKipPZ62TB2UzjG5jsY7x_qYJJ2RI5pQdYP52Ody7VRByGQ4-Fv5DudLlcWJgf5_aX1B0RXF3Wzhk8QHj3rXtw\" data-src=\"https://lh4.googleusercontent.com/4XV5Cb2VDDNidpL-bGRSQRAlRJKXgoCggsYC43W9OT2pkgp7SpBzO1XM8bSRGKipPZ62TB2UzjG5jsY7x_qYJJ2RI5pQdYP52Ody7VRByGQ4-Fv5DudLlcWJgf5_aX1B0RXF3Wzhk8QHj3rXtw\" data-image-enhancer=\"larger than third of 645\" /></span></div>\r\n<strong>A few tips to improve the reach of your Facebook event:</strong>\r\n<ul>\r\n 	<li>Add directions or a map to make it easy for people to find your event.</li>\r\n 	<li>Invite up to 500 people.</li>\r\n 	<li>Share your event and/or promote it as an ad.</li>\r\n</ul>\r\n<h3><strong>3. Use Groups</strong></h3>\r\nGroups offer a wide variety of local Facebook marketing advantages. Some of the best include:\r\n<ul>\r\n 	<li>Listing and selling products</li>\r\n 	<li>Building a community</li>\r\n 	<li>Establishing expertise</li>\r\n 	<li>Networking</li>\r\n 	<li>Offering great customer service</li>\r\n</ul>\r\n<a href=\"http://www.socialmediaexaminer.com/9-ways-to-use-facebook-groups-for-business/\" target=\"_blank\" rel=\"noopener\">The possibilities</a> for creating and managing a group on Facebook are only limited by your imagination. <strong>Groups are the perfect place to create a controlled community within your target audience</strong>. As the admin of the group, you can approve or reject all posts, accept or block members, and direct the commentary.\r\n\r\n<strong>Groups allow you to build a micro-community that is hyper-focused on the subject of your choosing</strong>. For example, a business that sells laptop cases could create an entire Facebook group centered around laptop cases and their various uses, the best kinds, how to determine product quality, and humorous customer stories.\r\n<h3><strong>4. Share Local Content</strong></h3>\r\nOne thing that’s consistent across Facebook is that people love to celebrate local pride. <strong>Align your business with famous events, history, people, landmarks, sayings, and other nuances that are part of your city’s identity</strong>. Share content from local organizations that captures the essence of your locale and will interest to your audience.\r\n<div><span class=\"pinContainer\"><img id=\"image5\" class=\"pinable\" title=\"mage-5.png\" src=\"https://lh3.googleusercontent.com/0vmtR2P6ZY_p-SxL-njhhPy3lFFqW3ccSpaPwWwGo8FHRECiKreUkmJoBnLN8OnkKHv2bi1X5nAw1ZsC158GPd94l5Oq7R1-mjij4xbKKZ_goRovyDWmAQxBKG2VlcP9fJEAtu_tpITUCuMYPA\" data-pre-sourced=\"yes\" data-sourced=\"yes\" data-original=\"https://lh3.googleusercontent.com/0vmtR2P6ZY_p-SxL-njhhPy3lFFqW3ccSpaPwWwGo8FHRECiKreUkmJoBnLN8OnkKHv2bi1X5nAw1ZsC158GPd94l5Oq7R1-mjij4xbKKZ_goRovyDWmAQxBKG2VlcP9fJEAtu_tpITUCuMYPA\" data-src=\"https://lh3.googleusercontent.com/0vmtR2P6ZY_p-SxL-njhhPy3lFFqW3ccSpaPwWwGo8FHRECiKreUkmJoBnLN8OnkKHv2bi1X5nAw1ZsC158GPd94l5Oq7R1-mjij4xbKKZ_goRovyDWmAQxBKG2VlcP9fJEAtu_tpITUCuMYPA\" data-image-enhancer=\"larger than 645\" /></span></div>\r\nThese are examples of good local content topics:\r\n<ul>\r\n 	<li>13 Things Keeping Austin Weird</li>\r\n 	<li>How Boston’s “R”-less Accent Became So Famous</li>\r\n 	<li>The Best Festivals to Attend this Summer in San Diego</li>\r\n</ul>\r\nMake your Facebook page an extension of the culture and traditions surrounding your location.\r\n<h3><strong>5. Mention Local Businesses, Events, and Groups</strong></h3>\r\nIf you’re looking for ways to build engagement and gain traction, tag accounts that share content which aligns with your audience’s interests. As with all things on social media, tagging can be overdone, so don’t start tagging pages in every post. Rather, choose the ones that will have the greatest impact and provide value to your audience.\r\n\r\nTagging is another great way to support local marketing efforts. Build hype for an event your company is hosting using a Facebook live video, or showcase company culture with a group photo at the next conference you attend. One word of caution: <strong>if you decide to try Facebook live, write a script</strong>. The last thing you want to do is live-stream without a plan.\r\n\r\nIn addition to page tags, groups can also be tagged. This is especially effective when you’re attending industry events or working on collaborations. Athletic wear brands, such as Puma, do an exceptional job promoting their collaborations on Facebook.\r\n<div><span class=\"pinContainer\"><img id=\"image6\" class=\"pinable\" src=\"https://lh4.googleusercontent.com/cPRd2T7WjubjpvjwyrMon0VisSfb5SiwCtJYUH3_E38z7g3WJb6nhyzAVt32zwlvd9IDCg7ls0IGqzapgF8mlroQAE3wOpOzWQfz0MXiNlaFMm01kphjUXdmNJ1elz4uLDEBBD1BD--hkZro_Q\" data-pre-sourced=\"yes\" data-sourced=\"yes\" data-original=\"https://lh4.googleusercontent.com/cPRd2T7WjubjpvjwyrMon0VisSfb5SiwCtJYUH3_E38z7g3WJb6nhyzAVt32zwlvd9IDCg7ls0IGqzapgF8mlroQAE3wOpOzWQfz0MXiNlaFMm01kphjUXdmNJ1elz4uLDEBBD1BD--hkZro_Q\" data-src=\"https://lh4.googleusercontent.com/cPRd2T7WjubjpvjwyrMon0VisSfb5SiwCtJYUH3_E38z7g3WJb6nhyzAVt32zwlvd9IDCg7ls0IGqzapgF8mlroQAE3wOpOzWQfz0MXiNlaFMm01kphjUXdmNJ1elz4uLDEBBD1BD--hkZro_Q\" data-image-enhancer=\"larger than 645\" /></span></div>\r\n<h3><strong>6. Tag Locations &amp; Events</strong></h3>\r\nI’m not talking about tagging your latest check-in at Olive Garden, <strong>I’m talking about event marketing, company outings, and business development trips</strong>. Manning a booth at Comic-Con? Post a group picture that tags the event and location. Taking the team out for someone’s Birthday lunch? Tag the location and upload a boomerang. Checking out your latest digital billboard downtown? Tag the location and upload a picture.\r\n\r\nAdd some variety to your Facebook page by tagging locations and show off your company’s personality at the same time.\r\n<h3><strong>7. Run a Contest</strong></h3>\r\nEverybody likes to win things. There are many different ways to run a Facebook contest. The two most popular include hosting a promotion on a Facebook app or on your Page’s Timeline.\r\n\r\nPay close attention to <a href=\"https://www.facebook.com/communitystandards\" target=\"_blank\" rel=\"noopener\">Facebook’s content rules</a> because disregarding them could get your contest shutdown. Here are just a few things you <em>can’t</em> do:\r\n<ul>\r\n 	<li>You can’t require participants to share a page or post on your Timeline to enter</li>\r\n 	<li>You can’t require participants to like a page to enter</li>\r\n 	<li>You can’t require participants to tag themselves in pictures to enter</li>\r\n</ul>\r\nThe list goes on. Review a thorough breakdown of what you can and can’t do when running a Facebook contest <a href=\"https://www.shortstack.com/is-your-facebook-contest-legal-infographic/\" target=\"_blank\" rel=\"noopener\">here</a>. Helpful hint: even though you can’t <em>require</em> page likes, photo tagging, and timeline posting, you can still encourage the audience to complete those actions.\r\n<h3><strong>8. Encourage Foot Traffic</strong></h3>\r\nRetail companies often struggle to make Facebook work in their favor. <strong>The biggest problem is getting people online to come into the store</strong>. Here are a few tips to start turning Facebook followers into foot traffic that have revenue potential:\r\n<ul>\r\n 	<li>Create polls and contests centered on popular products and their uses</li>\r\n 	<li>Run regular in-store events your customers are interested in</li>\r\n 	<li>Promote in-store coupons, giveaways, and sweepstakes</li>\r\n 	<li>Build a shop directly on Facebook where your customers can purchase your products</li>\r\n 	<li>Align your page with causes your audience cares about</li>\r\n</ul>\r\nThink of Facebook as your marketing email and your store as the landing page. In order to get people from the digital universe to visit your physical business, you need to have a compelling message and offer they can’t refuse. For example, if there’s a large sales conference in town you could create a set of Facebook ads that are focused on the area surrounding the conference center and targets sales professionals over the age of 21. Offer a lunch discount and provide all the details they need to make a quick meal grab before heading to their next session.\r\n<h3><strong>9. On-Site Promotion of Your Facebook Page</strong></h3>\r\nTry to convert the foot traffic your business attracts into online brand advocates. Use signage, receipts, business cards, flyers, coupons and more to ask for page likes, check-ins, reviews, and posts on your Facebook Timeline.\r\n\r\nHere are a few ideas to get you started:\r\n<ul>\r\n 	<li>Give away a $200 gift card that requires participants to post a picture taken in front of a branded mural, sign, or display that tags your Facebook page.</li>\r\n 	<li>Offer a 20% off discount for everyone who checks-in at your store on a Wednesday.</li>\r\n</ul>\r\nExecuting successful Facebook local marketing tactics requires consistent testing and experimentation. What works for a retail business might not work for a restaurant, and vice versa.\r\n\r\nTake the time to figure out what your audience responds to the best and what generates the most business for your company through Facebook. <strong>Successful Facebook local marketing can take time. Be patient, detail oriented and persistent.</strong>','9 Proven Tactics of a Successful Local Facebook Marketing Strategy','','publish','open','open','','9-proven-tactics-of-a-successful-local-facebook-marketing-strategy','','','2018-01-09 20:53:11','2018-01-09 20:53:11','',0,'http://64.207.144.221/~lemontree/?p=12893',0,'post','',0),(12894,1,'2017-12-26 16:51:05','2017-12-26 16:51:05','At vero eos et accusamus et iusto odios unsip dignissimos ducimus qui blan ditiis prasixers esentium voluptatum un deleniti atquestepi sites excep non providentsim ...At vero eos et accusamus et iusto odios unsip dignissimos ducimus qui blan ditiis prasixers esentium voluptatum un deleniti atquestepi sites excep non providentsim ...At vero eos et accusamus et iusto odios unsip dignissimos ducimus qui blan ditiis prasixers esentium voluptatum un deleniti atquestepi sites excep non providentsim ...At vero eos et accusamus et iusto odios unsip dignissimos ducimus qui blan ditiis prasixers esentium voluptatum un deleniti atquestepi sites excep non providentsim ...','At vero eos et accusamus et iusto odios unsip dignissimos','','inherit','closed','closed','','12893-revision-v1','','','2017-12-26 16:51:05','2017-12-26 16:51:05','',12893,'http://64.207.144.221/~lemontree/index.php/2017/12/26/12893-revision-v1/',0,'revision','',0),(12895,1,'2017-12-27 08:12:32','2017-12-27 08:12:32','At vero eos et accusamus et iusto odios unsip dignissimos ducimus qui blan ditiis prasixers esentium voluptatum un deleniti atquestepi sites excep non providentsim ...At vero eos et accusamus et iusto odios unsip dignissimos ducimus qui blan ditiis prasixers esentium voluptatum un deleniti atquestepi sites excep non providentsim ...At vero eos et accusamus et iusto odios unsip dignissim