',0),(13107,1,'2018-04-07 07:44:38','2018-04-07 07:44:38','','EXE','','publish','closed','closed','','administration','','','2018-05-09 12:23:20','2018-05-09 12:23:20','',0,'http://iqac.diu.ac/?post_type=tmm&#038;p=13107',0,'tmm','',0),(13109,1,'2018-05-09 10:59:58','2018-05-09 10:59:58','','About us','','publish','closed','closed','','about','','','2018-05-10 09:55:43','2018-05-10 09:55:43','',0,'http://iqac.diu.ac/?page_id=13109',0,'page','',0),(13110,1,'2018-05-09 10:59:58','2018-05-09 10:59:58','IQAC Brief\r\n\r\nIn order to enhance and to get a continuous patronage of Quality Assurance (QA) culture at different entities/departments of Dhaka International University (DIU), the Institutional Quality Assurance Cell (IQAC) was constituted on 01 July 2015. The IQAC consists of seven (07) entities namely Law, CSE (Computer Science &amp; Engineering), English, EETE (Electrical, Electronics, &amp; Telecommunication Engineering), Business Administration, Pharmacy and Sociology. It is obvious that IQAC is a mutual endeavour between Dhaka International University and University Grants Commission (UGC), Bangladesh which is resolutely committed to ensure the practice of continuously improving quality culture, demonstrate responsibility and enhancement and thus, to satisfy the different stakeholders (Existing Students, Alumni, Academic and Non-Academic Staffs, Employer, etc.). The quality assurance areas covered by IQAC are based on governance, curriculum content design and review, student admission, progress and achievements, physical facilities, teaching-learning and assessment, student support services, staff and facilities, research and extension, as well as process management and continuous improvement. Having set up IQAC, a lot of workshops, training on different events and meetings are being conducted for improving the existing quality culture at different entities of this university. It is mentionable that IQAC itself conducted four (04) QAC (Quality Assurance Committee) meetings, 15 meetings which are related to IQAC fund, as well as 22 academic and non-academic training/workshops based upon Block Allocation till Nov. 2017. Moreover, to maintain an upgrading quality culture on teaching-learning methods and curriculum design, SA (Self-Assessment) Committees of different entities also conducted a lot of meetings with their faculty members. The External Peer Reviews (EPRs) of Law, CSE and English departments were successfully accomplished on 31 May-02 June 2017. Likewise, the EPRs of departments of Business Administration, Pharmacy, Sociology as well as EETE were fruitfully completed on 16-18 May, 25-27 May as well as on 13-15 July, 2017 respectively. Accordingly, all Reports of seven departments have already been submitted at QA (Quality Assurance) Unit, UGC after furnishing necessary improvement plans.','About','','inherit','closed','closed','','13109-revision-v1','','','2018-05-09 10:59:58','2018-05-09 10:59:58','',13109,'http://iqac.diu.ac/13109-revision-v1/',0,'revision','',0),(13111,1,'2018-05-09 11:01:18','2018-05-09 11:01:18',' ','','','publish','closed','closed','','13111','','','2018-05-10 09:56:41','2018-05-10 09:56:41','',0,'http://iqac.diu.ac/?p=13111',2,'nav_menu_item','',0),(13115,1,'2018-05-09 11:04:30','2018-05-09 11:04:30','','News & Events','','publish','closed','closed','','event','','','2018-05-09 14:47:30','2018-05-09 14:47:30','',0,'http://iqac.diu.ac/?page_id=13115',0,'page','',0),(13116,1,'2018-05-09 11:04:30','2018-05-09 11:04:30','','Event','','inherit','closed','closed','','13115-revision-v1','','','2018-05-09 11:04:30','2018-05-09 11:04:30','',13115,'http://iqac.diu.ac/13115-revision-v1/',0,'revision','',0),(13118,1,'2018-05-09 11:05:08','2018-05-09 11:05:08','','Resources','','publish','closed','closed','','resouce','','','2018-05-09 14:49:04','2018-05-09 14:49:04','',0,'http://iqac.diu.ac/?page_id=13118',0,'page','',0),(13119,1,'2018-05-09 11:05:08','2018-05-09 11:05:08','','Resouce','','inherit','c